// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Booklist from './Booklist';
import BookDetails from './BookDetails'; // Assuming you create this component

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Booklist} />
        <Route path="/book/:index" component={BookDetails} />
      </Switch>
    </Router>
  );
};

export default App;
